import React from 'react'

function Columns() {
  return (
    <React.Fragment>
        {
            items.map( item => (
                <React.Fragment key = {item.id}>
                    <h1>Titke</h1>
                    <p>{item.title}</p>
                 </React.Fragment>
            ) )
            
        }
      <td>Name</td>
      <td>Seun</td>
    </React.Fragment>
  )
}

export default Columns
